import { Grid } from "@mui/material";
import React from 'react';
const Home = () => {
  return <>
    <Grid container justifyContent='center'>
      <Grid item sm={10}>
        <h1>Home Page</h1>
        <hr />
        <p>This is Home</p>
      </Grid>
    </Grid>
  </>;
};

export default Home;
